INSERT INTO `np_areas` VALUES ('140200', '40.076816', '113.300126', '140000', '大同市', '1', '大同', 'Datong', '037000', '0352', '53487', '', 'D', '大同市位于山西省北部，地处黄土高原东北边缘。地理坐标为东经112°34′到114°33′，北纬39°03′到40°44′之间，平均海拔1056米。北以外长城为界，与内蒙古自治区相邻，西、南与本省朔州市、忻州地区相连，东与河北省相接。', '全市总人口300多万。', '分大同市辖城区、矿区、南郊区、新荣区四个区和阳高县、天镇县、广灵县、灵丘县、浑源县、大同县、左云县七个县。', '', '', '', '华北', '0', '1');
