INSERT INTO `np_areas` VALUES ('320000', '32.061241', '118.762313', '320000', '江苏省', '0', '江苏', 'Jiangsu', '0', '0', '58238', '', 'J', '地处我国东部沿海。东濒黄海，西邻安徽，北连山东，南接浙江、上海，是全国地势最低平的省（区），全省总面积10多万平方公里，其中，平原面积占69%，河湖面积占17%，均为全国各省（区）之首。', '7438万', '全省设13个省辖市，省会南京市。', '10.26万平方公里', '苏', '南京', '华东', '0', '1');
