INSERT INTO `np_areas` VALUES ('320300', '34.259827', '117.19108', '320000', '徐州市', '1', '徐州', 'Xuzhou', '221000', '0516', '58027', '', 'X', '位于江苏省西北部的徐州，是苏北最大城市和由苏、鲁、豫、皖边区组成的淮海经济区的中心。京沪、陇海两大铁路干线在这里交汇，作为“北国锁钥”，“南国门户”，自古便为兵家必争之地，素称“五省通衢”。全市总面积11258平方公里，其中市区面积963平方公里。', '全市总人口896万，其中市区人口160多', '辖云龙、鼓楼、九里、泉山、贾汪5个区，新沂、邳州2个县级市和铜山、睢宁、沛县、丰县4个县。', '', '', '', '华东', '0', '1');
