INSERT INTO `np_areas` VALUES ('370400', '34.8105', '117.323725', '370000', '枣庄市', '1', '枣庄', 'Zaozhuang', '277000', '0632', '58024', '', 'Z', '优越、交通便利，50公里半径之内有徐州、连云港、济宁、临沂4个飞机场，有石臼、岚山、连云港3个出海口，京沪铁路、京福高速公路、104国道、206国道穿境而过；全市二级以上公路577.3公里，公路密度为每平方公里35.7公里，境内铁路全长288.5公里；举世闻名的京杭大运河穿过市区南部，顺流而下与江苏、安徽、上海、浙江等省市相通，每年有大量的优质煤炭、水泥、石膏等运往各地。台儿庄船闸是京杭运河上最大的船闸，两千吨级的船舶可自由出入，境内形成了由航空、铁路、公路、水运等组成的综合运输网络。&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; 枣庄市邮电通讯设施配套齐全，采用光', '民族:全市（县、区）总人口３６０．３万人', '枣庄市位于苏鲁两省交界处，是山东省的南大门，距京沪-陇海铁路交汇城市徐州仅９０公里，东与临沂市的费县、苍山县为邻，西濒独山湖、昭阳湖、微山湖，北靠 济宁的邹城市。市机关驻地枣庄。市境西北至东南为一长方形，东西最宽５６公里，南北最长９６公里。总面积４５５０平方公里，占山东省总面积的２．９％。', '', '', '', '华东', '0', '1');
