INSERT INTO `np_areas` VALUES ('410300', '34.618154', '112.454363', '410000', '洛阳市', '1', '洛阳', 'Luoyang', '471000', '0379', '57073', '', 'L', '洛阳位于河南省西部，三面环山，另一面是广袤的沃野平原。它东面的虎牢关和西面的函谷关是古代东西交通的咽喉，北面的孟津是古代黄河的重要渡口，南面的轩辕关是洛阳通往江汉平原的重要关口，地理位置十分重要。', '600万', '下辖老城区、西工区、涧西区、廛河回族区、郊区、吉利区、偃师市、孟津县、汝阳县、伊川县、洛宁县、嵩县、宜阳县、新安县、栾川县。', '', '', '', '华中', '0', '1');
