INSERT INTO `np_areas` VALUES ('371500', '36.456696', '115.985371', '370000', '聊城市', '1', '聊城', 'Liaocheng', '252000', '0635', '54806', '', 'L', '聊城市地处北纬35°47’~37 °02’ 和东经115°16’~116 °32 ’之间，位于鲁西，临河南、河北，位于华东、华北、华中三大行政区交界处。', '人口500多万。', '分现辖东昌府区、临清市和冠县、莘县、阳谷、东阿、茌平、高唐6个县和1个经济技术开发区，下辖126个乡（镇、办事处），6596个行政村（居委会）。', '', '', '', '华东', '0', '1');
