INSERT INTO `np_areas` VALUES ('441900', '23.020536', '113.751766', '440000', '东莞市', '1', '东莞', 'Dongguan', '523000', '0769', '59289', '', 'D', '地处中国大陆南部，广东省中南部，珠江口东岸，东江下游的珠江三角洲北接广州，南连深圳，毗邻香港。', '644.57万人', '辖4个区（莞城、南城、万江、东城）、28个镇（石碣、石龙、茶山、石排、企石、横沥、桥头、谢岗、东坑、常平、寮步、大朗、黄江、清溪、塘厦、凤岗、长安、虎门、厚街、沙田、道窖、洪梅、麻涌、中堂、高步、樟木头、大岭山、望牛墩）。', '', '', '', '华南', '0', '1');
INSERT INTO `np_areas` VALUES ('512000', '30.129463', '104.628889', '510000', '资阳市', '1', '资阳', 'Ziyang', '641300', '028', '56298', '', 'Z', '位于四川盆地中心区域', '500万', '辖雁江区、安岳县、乐至县，代管简阳市，资阳市委、市政府驻雁江区。', '', '', '', '西南', '0', '1');
INSERT INTO `np_areas` VALUES ('510000', '30.650892', '104.076418', '510000', '四川省', '0', '四川', 'Sichuan', '0', '0', '56294', '', 'S', '地处中国西南腹地，占据着四川盆地绝大部分。这块美丽而神奇的盆地，西被青藏高原扼控，东有长江三峡之险，南为云贵高原所拱卫，北是秦岭巴山屏障。', '8500万左右，有汉、彝、藏、羌等50余', '共 有21个市、地、州、辖177个县（市、区）。其中有13个地级市、5个地区。3个自治州。18个县级市，35个市辖区。124个县，3个自治县', '48万平方公里', '川或蜀', '成都', '西南', '0', '1');
INSERT INTO `np_areas` VALUES ('620000', '36.0593', '103.826363', '620000', '甘肃省', '0', '甘肃', 'Gansu', '0', '0', '52889', '', 'G', '甘肃省地处北纬32°11′~42°57′、东经92°13′~108°46′之间。位于祖国西部，地处黄河上游，黄土、青藏和蒙古三大高原交汇地带。东接陕西，南邻四川，西连青海、新疆，北靠内蒙、宁夏并与蒙古人民共和国接壤。', '2237.11万', '现辖5个地级市，2个自治州， 8个县级市，60个县，7个自治县。', '总面积约45.4万平方公里。', '甘或陇', '兰州', '西北', '0', '1');
