INSERT INTO `np_areas` VALUES ('650200', '45.579889', '84.889207', '650000', '克拉玛依市', '1', '克拉玛依', 'Karamay', '834000', '0990', '51243', '', 'K', '克拉玛依市地处东径80°44′～86°1′,北纬44°7′～46°8′之间。 位于准噶尔盆地西北缘，加依尔山南麓，东北与和布克赛尔蒙古自治县相邻，东南与沙湾县相接，西部与托里县和乌苏县毗连。', '人口40万左右。', '分现辖克拉玛依、独山子、六十户、乌尔禾、百口泉、红山嘴、前山捞坝、白碱滩、小拐、中拐、大拐等地区。', '', '', '', '西北', '0', '1');
