INSERT INTO `np_areas` VALUES ('653000', '39.714556', '76.167644', '650000', '克孜勒苏柯尔克孜自治州', '1', '阿图什', 'KizilsuKirgiz', '845350', '0908', '51704', '', 'K', '克孜勒苏柯尔克孜自治州位于东经73°26′05″～78°59′02″，北纬37°41′28″～41°49′41″之间。东北部、北部地处天山山区，西南部处于昆仑山北坡，西北部、西部地处帕米尔高原崇山峻岭之中，东南部是塔里木盆地边缘古老的喀什噶尔绿洲。西部与吉尔吉斯斯坦、塔吉克斯坦两个国家接壤，东部与阿克苏地区的乌什、柯坪两县相连，南部与喀什地区的喀什市、巴楚、伽师、莎车、英吉沙、疏附县及塔什库尔干塔吉克自治县毗邻。', '人口40多万。', '分克孜勒苏柯尔克孜自治州辖阿图什、阿克陶、乌恰、阿合奇1市3县，有5个镇，2个街道办事处，32个乡(内含1个塔吉克族乡)，208个行政村。', '', '', '', '西北', '0', '0');
