INSERT INTO `np_areas` VALUES ('652800', '41.764131', '86.145267', '650000', '巴音郭楞蒙古自治州', '1', '库尔勒', 'Bayingolin', '841000', '0996', '51656', '', 'B', '巴州地处东经82°38′—93°45′，北纬35°38′—43°36′之间。位于新疆维吾尔自治区东南部。东邻甘肃、青海；南倚昆仑山与西藏相接；西连和田、阿克苏地区；北以天山为界与伊犁、塔城、昌吉、乌鲁木齐、吐鲁番、哈密等地、州、市相连。', '人口100万。', '分现辖库尔勒市和焉耆、和静、和硕、博湖、轮台、尉犁、若羌、且末八县。', '', '', '', '西北', '0', '0');
