INSERT INTO `np_areas` VALUES ('652200', '42.819433', '93.515052', '650000', '哈密地区', '1', '哈密', 'Hami', '839000', '0902', '52203', '', 'H', '哈密市地处东经91°06′33″—96°23′00″，北纬40°52′47″—45°05′33″，位于新疆东部，是新疆通往内地的门户，是古\"丝绸之路\"上的重镇。东部与甘肃省酒泉地区相邻，西部与昌吉回族自治州的木垒县和吐鲁番地区鄯善县毗邻，北依天山山脉，南部与巴音郭楞蒙古自治州的若羌县接壤，东北部与蒙古国接壤。', '人口51万。', '分现辖一市两县，即哈密市、伊吾县、巴里坤哈萨克自治县。', '', '', '', '西北', '0', '0');
