INSERT INTO `np_areas` VALUES ('650100', '43.825666', '87.617298', '650000', '乌鲁木齐市', '1', '乌鲁木齐', 'Urumqi', '830000', '0991', '51463', '', 'W', '乌鲁木齐市位于东经86°37’33\"- 88°58’24\"，北纬42°45’32\"- 44°08’00\"。地处欧亚大陆腹地，天山北麓、准噶尔盆地南缘，是新疆维吾尔自治区的首府，是全疆政治、经济、文化、科技的中心，南北疆交通的枢纽，也是第二座欧亚大陆桥中国西段的桥头堡，我国西部对外开放的重要门户。', '人口100多万。', '分市辖7区1县，即天山区、沙依巴克区、新市区、水磨沟区、头屯河区、东山区、南山矿区和乌鲁木齐县。还有两个国家级开发区即乌鲁木齐高新技术产业开发区和乌鲁木齐经济技…', '', '', '', '西北', '0', '1');
