INSERT INTO `np_areas` VALUES ('659001', '44.306119', '86.080497', '650000', '石河子市', '1', '石河子', 'Shihezi', '832000', '0993', '51356', '', 'S', '石河子垦区地处天山北麓中段，古尔班通古特大沙漠南缘，即东径84’58\"-86’24\",北纬43’26\"-45’20\"。全垦区面积7529平方公里，自治区直辖市－石河子市位于垦区中部，南倚天山，东以玛纳斯河为界与玛纳斯县为邻，南、西、北三面与沙湾县环接。', '人口60万左右。', '分石河子市是新疆维吾尔自治区直辖市，现辖4个街道办事处和1个石河子乡。', '', '', '', '', '0', '1');
