INSERT INTO `np_areas` VALUES ('820000', '22.198745', '113.543873', '820000', '澳门特别行政区', '0', '澳门', 'Macao', '999078', '0', '45011', '', 'A', '位于中国南海之滨珠江口西侧，由澳门半岛、凼仔岛和路环岛三部分组成，北与广东省珠海经济特区相连，西跨莲花大桥与珠海市横琴岛相通，东与香港隔海相望，相距仅60公里左右。', '50.3万', '澳门地区包括澳门半岛与凼仔、路环两个离岛，行政事务均直接由澳门政府管辖，仅设澳门市政厅和海岛市政厅分别管理半岛和离岛的市政事务。半岛又分为5 个区，亦无区行政管理机关，只是地域上的划分，各区以区内主要教堂命名（它们实际上是原来天主教会的堂区）。5个区为：花地玛堂区、花地玛堂区、望德堂区、大堂区、风顺堂区', '', '', '', '', '0', '0');
