INSERT INTO `np_areas` VALUES ('653200', '37.114157', '79.922211', '650000', '和田地区', '1', '和田', 'Hetian', '848000', '0903', '51828', '', 'H', '和田市地处东经79°50′20〞-79°56′40〞，北纬36°59′50〞-- 37°14′23〞，位于新疆最南端，地处喀喇昆仑山与塔克拉玛干大沙漠之间，全市南高北底，北宽南窄，由南向北倾斜。是喀拉喀什河与玉龙喀什河的冲积平原。', '人口160多万。', '分和田地区辖和田市、和田县、皮山县、墨玉县、洛浦县、策勒县、于田县、民丰县1市7县，86个乡镇，4个街道办事处，28个居委会，1404个行政村，6094个村民小组，还有兵团和田农场管理局及所属奴尔牧场、四十七团场、皮山农场。', '', '', '', '西北', '0', '0');
