INSERT INTO `np_areas` VALUES ('652700', '44.905588', '82.066159', '650000', '博尔塔拉蒙古自治州', '1', '博乐', 'Bortala', '833400', '0909', '51238', '', 'B', '博尔塔拉蒙古自治州地处东经79°53′-83°53′，北纬44°02′-45°23′，在亚欧大陆腹地，位于新疆维吾尔自治区西北部。东部与塔城地区相连，南部与伊犁地区相依，西北部与哈萨克斯坦共和国接壤。', '人口40多万。', '分博尔塔拉蒙古自治州现辖博乐市、精河县、温泉县两县一市和阿拉山口口岸行政管理区。', '', '', '', '西北', '0', '0');
