INSERT INTO `np_areas` VALUES ('653100', '39.4704', '75.989755', '650000', '喀什地区', '1', '喀什', 'Kashi', '844000', '0998', '51709', '', 'K', '地处东经75°56′～76°04′，北纬39°15′～39°35′之间。祖国的西部边陲，位于新建的西南部。东临塔克拉玛干大沙漠，南依喀喇昆仑山，与西藏阿里地区为邻，西靠帕米高原，与吉尔吉斯斯坦、塔吉克斯坦、巴基斯坦、阿富汗、印度接壤，北接天山与新疆克孜勒苏柯尔克孜自治州和阿 克苏地区相连。', '人口300多万。', '分辖1个市11个县，喀什市、疏附县、疏勒县、英吉沙县、岳普湖县、伽师县、莎车县、泽普县、叶城县、麦盖提县、巴楚县和塔什库尔干塔吉克自治县。全区共有8个区，26个镇、4个街，141个乡．2310个村民委员会点6个居民委员会。', '', '', '', '西北', '0', '0');
INSERT INTO `np_areas` VALUES ('652300', '44.011183', '87.308225', '650000', '昌吉回族自治州', '1', '昌吉', 'Changji', '831100', '0994', '51368', '', 'C', '昌吉州地处经85°34′至91°32′，北纬43°06′至45°38′；位于地处天山北麓，准噶尔盆地南缘，东邻乌鲁木齐和哈密地区，西与石河子市相接，南与吐鲁番、巴音郭楞蒙古自治州相连，北与阿尔泰、塔城地区接壤，东北与蒙古国交界，从东、西、北三面环抱乌鲁木齐市。', '人口100多万。', '分全州辖昌吉市、阜康市、米泉市、玛纳斯县、呼图壁县、吉木萨尔县、奇台县、木垒哈萨克自治县等5县3市。', '', '', '', '西北', '0', '0');
