INSERT INTO `np_areas` VALUES ('632700', '33.005822', '97.006636', '630000', '玉树藏族自治州', '1', '玉树', 'Yushu', '815000', '0976', '56029', '', 'Y', '位于青海省的西南部', '25.27万人', '辖6县，自治州政府驻玉树县 玉树县(结古镇) 杂多县(萨蒲塘) 称多县(周均) 治多县(加吉博洛格) 囊谦县(香达乡) 曲麻莱县(约改滩)', '', '', '', '西北', '0', '0');
INSERT INTO `np_areas` VALUES ('622900', '35.601182', '103.210539', '620000', '临夏回族自治州', '1', '临夏', 'Linxia', '731100', '0930', '52984', '', 'L', '临夏回族自治州位于黄河上游,甘肃省中部西南面,东临洮河与定西地区相望, 西倚巍峨雄壮的积石山与青海省毗邻, 南靠奇峻翠秀的太子山与甘南藏族自治州搭界,北濒湟水与兰州市接壤,地处青藏高原与黄土高原过渡地带。', '人口100多万。', '分临夏回族自治州现辖7县1(市),即临夏市、临夏县、永靖县、和政县、广河县、康乐县、东乡族自治县、积石山保安族东乡族撒拉族自治县,共138个乡(镇、街办)。', '', '', '', '西北', '0', '0');
