INSERT INTO `np_areas` VALUES ('650000', '43.793147', '87.627546', '650000', '新疆维吾尔自治区', '0', '新疆', 'Xinjiang', '0', '0', '51463', '', 'X', '新疆维吾尔自治区地处位于中国西北部，亚欧大陆中心。新疆东南部连接中国的甘肃、青海等省和南部连接西藏自治区外，其余与蒙古、俄罗斯、哈萨克斯坦、吉尔吉斯斯坦、塔吉克斯坦、阿富汗、巴基斯坦、印度等八个国家接壤，边境线长达54000公里，是中国边境线最长，对外口岸最多的一个省区。', '人口1700多万。', '自治区现辖13个地州、17个市、70个县、844个乡镇，其中132个镇、 670个乡和42个民族乡。', '总面积160多万平方公里。', '新', '乌鲁木齐', '西北', '0', '1');
