INSERT INTO `np_article` VALUES ('1', '给手机“开天窗”，这绝对是被低估的手机设计', '1', '这一块小屏也在某种程度上代表了这么一种延伸吧，毕竟李楠也是在日本留过学，在nec干过，所以把以前在日本手机上很棒的那一套设计用过来也就不难理解了。', '这一块小屏也在某种程度上代表了这么一种延伸吧，毕竟李楠也是在日本留过学，在nec干过，所以把以前在日本手机上很棒的那一套设计用过来也就不难理解了。', '2018-01-10 16:03:22', '2018-01-10 16:03:22', '/public/uplaod/630339fee31b6788c33fd7c67d78ef80-07b2c50f47cd95b5808401722492fc30.jpeg', '1', '1');
INSERT INTO `np_article` VALUES ('3', '微信里最让人讨厌的5种行为，希望你没有', '1', '朋友圈本来就是大家在一起交流生活的地方，但是有的人却当做了炫耀自己的，以自己为中心。', '<blockquote>1喜欢刷屏</blockquote><p>见到了什么样的人，吃了什么好吃的，今天为什么生气了，谁又给自己发短信了</p><p><span style=\"background-color: rgb(249, 150, 59);\">凡是自己的家长里短都喜欢发??</span></p><p>其实很多是没有意义的，你讲大概的就好了</p><p><!--StartFragment--><!--EndFragment--></p><p>总是这样，不过是在给人传递负能量。</p><p></p><blockquote>2微商加好友\n</blockquote>这点是我最反感的，就喜欢在朋友圈发布自己的产品。\n<br><font color=\"#c24f4a\">有的时候还会发一些很露骨的视频来博取关注。\n</font><br>每次点开朋友圈，只是为了看大家最近发生了什么，有什么新的动态，结果都是这群人 的产品，很让人无语。<p></p><p><img src=\"/public/uplaod/c0e0a09c95944b0b81fd9efe14aa6385-e3273191215fc89594980a4b9fe1f650.jpeg\" style=\"max-width:100%;\"><br></p><table border=\"0\" width=\"100%\" cellpadding=\"0\" cellspacing=\"0\"><tbody><tr><th>喜欢创建表格&nbsp;</th><th>喜欢吃好吃的&nbsp;</th></tr><tr><td style=\"text-align: center;\">&nbsp;喜欢喝水</td><td style=\"text-align: center;\">&nbsp;喜欢哭</td></tr></tbody></table><p><br></p>', '2018-01-10 16:03:41', '2018-01-10 16:03:41', '/public/uplaod/39716b5a91a1612c1d6a162c1947295e-a599d729e5ecd57b3fc443fec54829ed.jpeg', '1', '1');
INSERT INTO `np_article` VALUES ('4', 'OpenAI 新论文疑似“作弊”，谁才是最优强化学习算法？', '1', '【新智元导读】OpenAI 日前提出了一类强化学习替代方法，号称能与最先进的方法相媲美乃至更好。但是，昨天却有用户在 Github 表示“他们有点儿作弊了”，称结果无法复现。这究竟是怎么回事？', '<p>OpenAI 日前发布了一类新的强化学习算法——近端策略优化（Proximal Policy Optimization，PPO），称这类算法的实现和调参更加简单，并且性能与当前最佳方法相当乃至更好。PPO 也是如今 OpenAI 默认使用的强化学习算法。</p><p>昨天，一位用户在 Github 上提出质疑，表示根据他的使用经验，PPO 并没有 OpenAI 说的那么好。</p><p>“OpenAI 日前提出了一种号称比强化学习速度更快、需要较少超参数调整的替代方案。到目前为止，我的经验并不支持这些说法。”Github 用户 peastman 留言说：“在我的大部分测试中，它比 A3C 慢，而不是更快。并且，它和 A3C 有相同的超参数，还添加了几个新的参数。”</p><p>当然，peastman 也表示，也许他的情况是个例，其他人或许能成功复现 OpenAI 的论文。</p><p>peastman 表示，OpenAI PPO 论文的作者“有点作弊了”（kind of cheat）。“他们并没有把 PPO 与 A3C 进行比较。相反，作者比较的是他们称为‘A2C’的单线程版本，并且仅仅基于性能如何随着训练步骤数量增多而提升。作者没有考虑性能与时钟时间的关系。这隐去了一个非常重要的问题：PPO 无法并行运行，因为它在一个线程上执行所有优化，所有其他线程都处于空闲状态。”</p><p>“此外，PPO 每一组 rollout 都运行几个优化周期，因此每步的 CPU 时间要高得多。作者在论文中的比较再次产生了很大的误导。他们说，PPO 在 100 万次训练步骤后，比‘A2C’性能更好，但并没有提到 A3C 可以在相同的时钟时间内完成 400 万次的训练步骤。”</p><p>“每次迭代，都必须先生成所有的 rollout，然后在多个 epoch 中重复在优化器里运行所有这些。而且，你需要先把这些都完成了，才能开始生成下一组 rollout。”</p><p><strike>让 peastman 如此纠结的 PPO 究竟是什么呢？</strike></p><p>OpenAI 论文：近端策略优化算法 PPO</p><blockquote>摘要</blockquote><p><!--StartFragment--><!--EndFragment--></p><p>我们为强化学习提出了一类新的策略梯度法，可以通过与环境的交互在样本数据（sampling data）中进行转换，使用随机梯度下降优化替代目标函数（surrogate objective function）。标准的策略梯度法是在每一个数据样本上执行一次梯度更新，而我们提出的新目标函数可以在多个训练步骤（epoch）中实现小批量（minibatch）的更新。这种新方法称为近端策略优化（proximal policy optimization，PPO）。PPO 拥有置信域策略优化（TRPO）的一些好处，但更加容易实现，也更通用（general），并且根据我们的经验有更好的样本复杂度。我们在一组基准任务上测试了 PPO，包括模拟机器人运动和玩 Atari 游戏，这些基准测试表示 PPO 要比其他在线策略梯度法更好。考虑到总体的复杂度、操作简便性和 wall-time，PPO 是一种更好的选择。</p>', '2018-01-10 16:02:56', '2018-01-10 16:02:56', '/public/uplaod/8d70c17eb68367dbb1e6d0ec26d82476-a599d729e5ecd57b3fc443fec54829ed.jpeg', '1', '1');
INSERT INTO `np_article` VALUES ('5', '火就是神，彝族家家户户都有一个长年不息的火塘', '1', '“火就是神，神即是火。”这是彝族人民反映在其原始宗教中对于火的崇拜和敬畏。“如人和影子，不可来分开。”这又是彝家儿女在日常生产生活中融于火的挚情眷恋。正是这人与火的相濡以沫的情愫，使得这里的彝民对待火的态度，时时处处是恭恭敬敬，严严肃肃，彬彬有礼。', '<p><!--StartFragment-->一个新生儿降生下来，要在火塘边取名，在火塘边咿呀学语，传唱彝族古歌梅葛；新娘出嫁要向火塘添薪祈祷告别，新郎迎亲则要在火塘边与新娘及其家人同喝“转转酒”，以示热情和心中的喜悦；农业生产获得大丰收，要各取几粒荞籽、稗米、稻麦、包谷和瓜豆籽撒进火塘，烧得缕缕青烟绕梁来预示来年再创高产；人生了疾病或遭遇三灾八难，要用跨火塘的习俗来驱灾御邪，免除苦难。<!--EndFragment-->&nbsp;</p><p>&nbsp;<img src=\"/public/uplaod/bfb94501124eef0445c65a4ed1fd3976-ef0da6e67f29090f237888fa2d3e4909.jpeg\" style=\"max-width: 100%;\"><br></p><p>彝家火塘还是灵光闪烁的神圣之地，大多在火塘左边安设一灵位，尊称火神，视为祖先神灵之所在。每逢年过节，宰杀鸡羊猪，都须端上热气腾腾的上等酒肉饭菜，毕恭毕敬地摆上碗筷进行祭祀叩拜。</p><blockquote>彝家火塘，陪伴着山里人熬过了多少寒夜和冬天。依火塘，耍火把，祭火神……生活在现代大都市里的人，是无论如何也道不清弄不明彝家人与火塘千年一贯相濡与沫的情感的。</blockquote><p><!--StartFragment-->每每有宾朋远至，不论天气或冷或热，一律在火塘边接待。人们围着火塘载歌载舞，生命因燃烧而兴奋了，竹笛、葫芦笙吹得满天的繁星都在闪烁；月琴、大三弦弹得所有的大山都在旋转。<!--EndFragment-->&nbsp;&nbsp;<br></p><p><img src=\"/public/uplaod/830c3d27080428e3246e6c0b487f4510-c09bc642939d8f9404e7e411a605f4c2.jpeg\" style=\"max-width:100%;\"><br></p>', '2018-01-10 16:02:42', '2018-01-10 16:02:42', '/public/uplaod/3c3859790b04975c10b155e4050d1f62-07b2c50f47cd95b5808401722492fc30.jpeg', '1', '2');
INSERT INTO `np_article` VALUES ('6', '数字化进程的加快将在未来五年极大推动美国汽车金融的变革', '1', '波士顿咨询公司（BCG）26日发布报告称，数字化进程的加快将在未来五年极大推动美国汽车金融的变革，提高价值链上信息流动的透明度，带来更透明的客户参与、更灵活易得的贷款产品以及更精简的操作流程。', '<blockquote>据BCG数据，汽车贷款业务目前覆盖了美国85％新车和50％二手车交易，但汽车贷款流程过于复杂使行业发展速度缓慢。例如，如何评估新顾客群体的风险和如何将多家银行与客户需求匹配成为车贷业务中两大难题。</blockquote><blockquote>BCG合伙人兼董事总经理何大勇在报告中指出，目前有几项核心技术工具已经足够成熟，使数字平台能够通过操作简单的界面，为客户提供大量贷款选择。智能手机无处不在，方便汽车买家通过手机进行交易。云服务也能提供大数据分析，使得消费者挖掘到新的信贷机会。</blockquote><blockquote>此外，软件API（应用程序接口）可令各家公司合作更简便，贷款超市（集合型平台）也可以向客户展示不同机构的类似产品。新的安全科技和身份验证技术还可以使平台将过去的关键纸质流程实现数字化。在贷款直销公司和新的汽车购买平台上，客户都不需要通过经销商，能直接申请和获批贷款。</blockquote><p><!--StartFragment--><!--EndFragment--></p><blockquote>报告认为，汽车金融行业将发展成为充分数字化的市场。未来整个汽车购买、贷款和交付的全过程都会更数字化和更开放。贷款机构将能分析新客户的数据，重新评估新老客户群体的风险情况。客户不再需要为贷款而等待数个小时甚至数天时间，而是与集合平台合作，在几分钟内完成全部流程</blockquote>', '2018-01-22 17:41:41', '2018-01-22 17:41:41', '/public/uplaod/06d62c4c1afc351e63269ceb799de745-07b2c50f47cd95b5808401722492fc30.jpeg', '1', '1');
INSERT INTO `np_article` VALUES ('7', '中信联合易鑫入线上购车分期 汽车金融公司对战银行', '1', '银行等汽车金融市场主体正在从纯现金类贷款向场景类贷款转变。\n　　7月26日，中信银行信用卡中心与汽车互联网交易平台易鑫集团在深圳举行合作签约仪式，双方以发行联名信用卡、标准车主信用卡的形式合作进入汽车市场，中信银行借此布局汽车出行领域消费市场，包括购车、用车和养车等消费场景。', '<p>国内汽车市场以新车为主，二手车交易占比很低，4s店成为汽车金融的主战场。汽车金融利润率较高，是金融机构不可能放弃的优质资产。</p><p>　　中国私家车保有量已超1.3亿辆，包括加油、保险、维修在内每辆私家车每年约有2万元的消费，关联的车消费额高达2600亿元。“以现金贷做汽车金融，不良率在2%左右；以信用卡购车分期来做，不良率往往在千分之几。”有银行业内人士表示。</p><p>　　华南某汽车金融人士表示，就商业模式而言，金融机构从事汽车金融的模式不一。银行通常以信用卡分期购车业务为主，与汽车4s店驻店营销合作，这需要较多的人员与4s店对接。</p><p>　　21世纪经济报道记者了解到，对商业银行而言，汽车金融业务一般在各商业银行信用卡中心业务条线之下，属于零售银行之下。第一梯队中，包括四大行在内的商业银行由于资金成本较低，手续费在4%左右，能以较低成本从事汽车金融；第二梯队，包括招商银行、平安银行、中信银行等股份行，车贷利率略微提高，手续费在5%上下；也有部分银行采用现金贷方式从事汽车金融业务，利率较高。</p><p>　　中信银行相关人士在接受记者采访时表示，该行汽车金融业务模式选择与第三方平台合作，借助用户需求入口和消费转化场景，采用全线上模式。</p><p>　　汽车金融公司快速增长。7月26日，中国银行业协会汽车金融专业委员会年会发布数据显示，截至2016年末，汽车金融公司总资产5728.96亿元，同比增长36.73%。汽车金融公司零售贷款余额4265.41亿元，同比增长39.78%。全年累计实现净利润103.57亿元，同比增长39.94%。行业平均不良贷款率为0.37%，在当前经济形势下，汽车金融公司资产质量总体保持稳定，抗风险能力较强。</p><p>　　汽车金融的快速增长，带来对资金的需求，这类公司通过股东注资或资产证券化（abs）获得资金。</p><p><!--StartFragment--><!--EndFragment--></p><p>　　据统计，今年以来，已有9家汽车金融公司发行364亿元abs，规模较去年同期增长近五成。</p>', '2018-01-10 16:01:45', '2018-01-10 16:01:45', '/public/uplaod/45ea3c3e25018164674c7b8c4d5f9a87-a599d729e5ecd57b3fc443fec54829ed.jpeg', '1', '1');
INSERT INTO `np_article` VALUES ('8', '中信杀入线上购车分期 汽车金融公司对战银行忙增资', '1', '这与国外汽车金融市场对比鲜明。7月26日，波士顿咨询公司（BCG）发布报告称，汽车贷款业务目前覆盖了美国85%新车和50%二手车交易，但汽车贷款流程过于复杂使行业发展速度缓慢。例如，如何评估新顾客群体的风险和如何将多家银行与客户需求匹配成为车贷业务中两大难题。', '<p>中信银行信用卡中心总裁吕天贵表示，这代表信用卡产品布局由航空出行领域拓展至地面交通出行领域，拓展驾车出行类的细分市场。初期，中信银行将通过该信用卡提供加油、洗车、道路救援和机场停车等信用卡权益。</p><p>　　公开信息显示，易鑫集团是一家互联网汽车交易平台，投资人包括腾讯、京东、百度、易车等互联网巨头和东方资产（国际）、顺丰等，旗下业务包括新车贷款、二手车贷款、车抵贷等。</p><p><!--StartFragment--><!--EndFragment--></p><p>　　多位汽车金融人士在接受21世纪经济报道记者采访时表示，目前，中国汽车金融市场的渗透率在30%左右，即70%的购车者选择全款买车，其余30%使用汽车金融产品贷款买车；汽车金融参与主体众多，20%购车者选择银行，19%左右选择汽车金融公司，其他通过融资租赁、小贷和网贷平台等，但规模很小。</p>', '2018-01-10 16:01:33', '2018-01-10 16:01:33', '/public/uplaod/3379d2f89c934e24e93363ef097f8a78-a599d729e5ecd57b3fc443fec54829ed.jpeg', '1', '2');
INSERT INTO `np_article` VALUES ('9', '汽车金融行业堪称暴利 , 现已进入高速发展周期', '1', '汽车金融，是个实打实的暴利行业，汽车金融行业年净利润增长接近40%，不良率却仅为0.37%，汽车金融是以汽车为抵押标的，来向汽车金融机构贷款，由于有抵押、验资方便，因此汽车金融可以说是各类金融服务中手续最简单、不良率最低的金融服务了。', '<p><span>我国汽车金融市场发展到今天，已经经过了十几个年头。在此期间，我国汽车销量增长了3倍以上，但是汽车金融的渗透率却仅仅翻了一番，目前仍旧与国外70-80%的比重相差甚远。</span></p><p><span>当然，这一方面是由于国内消费者的消费意识与方式不同于国外，另一方面则是眼下汽车金融公司的资金来源所导致的，大部分汽车金融公司的资金主要来自于银行的资金拆借，这就使得其资金成本较高，利润水平必然会受到影响。而且，国内信用体系的不成熟也制约了行业的发展。</span></p><p><span>不过近年来，我国汽车金融市场的发展增速明显高于全球平均水平，最主要的原因是汽车金融消费主体的年轻化，对于汽车信贷的接受程度较高;而且如今征信体系的完善，使得汽车金融机构的验资更加方便;而且，从目前汽车金融机构发展的状况来看，汽车金融机构的融资渠道也进一步放宽。</span></p><p><!--StartFragment--><!--EndFragment--></p><p><span>据前瞻产业研究院《中国汽车金融行业市场前瞻与投资战略规划分析报告》的分析，当下我国汽车金融行业的市场规模已经超过6000亿元。</span></p>', '2018-01-10 16:01:23', '2018-01-10 16:01:23', '/public/uplaod/a972bbc709c7534e18f278de673fd661-07b2c50f47cd95b5808401722492fc30.jpeg', '1', '2');
