-- ----------------------------
-- Table structure for `np_terprise`
-- ----------------------------
DROP TABLE IF EXISTS `np_terprise`;
CREATE TABLE `np_terprise` (
  `en_id` int(11) NOT NULL AUTO_INCREMENT,
  `en_name` varchar(255) DEFAULT NULL COMMENT '企业名称',
  `en_regmoney` varchar(255) DEFAULT NULL COMMENT '注册资金',
  `en_person_name` varchar(255) DEFAULT NULL COMMENT '法人姓名',
  `en_person_idcard` int(60) DEFAULT NULL COMMENT '身份证',
  `en_contact` varchar(255) DEFAULT NULL COMMENT '联系方式',
  `enuser_name` varchar(255) DEFAULT NULL COMMENT '负责人',
  `enuser_idcard` int(60) DEFAULT NULL COMMENT '负责人身份证号',
  `enuser_contact` varchar(255) DEFAULT NULL COMMENT '负责人联系方式',
  `enuser_city_id` int(11) DEFAULT NULL COMMENT '负责区域城市关联表id',
  `enuser_address` varchar(255) DEFAULT NULL COMMENT '工作地址',
  `enuser_uid` int(11) NOT NULL COMMENT '关联用户',
  `en_time` varchar(60) NOT NULL COMMENT '认证时间',
  `en_status` int(1) NOT NULL COMMENT '是否有效1,有效.0无效',
  `legal_idcard_up` varchar(255) DEFAULT NULL COMMENT '法人身份证正面照',
  `legal_idcard_down` varchar(255) DEFAULT NULL COMMENT '法人身份证反面照',
  `duty_idcard_up` varchar(255) DEFAULT NULL COMMENT '负责人身份证正面照',
  `duty_idcard_down` varchar(255) DEFAULT NULL COMMENT '负责人身份证反面照',
  `license_card` varchar(255) DEFAULT NULL COMMENT '营业执照',
  `city_id` int(11) DEFAULT NULL COMMENT '城市id',
  PRIMARY KEY (`en_id`)
) ENGINE=InnoDB AUTO_INCREMENT=11 DEFAULT CHARSET=utf8 COMMENT='用户与企业关联表';

