-- ----------------------------
-- Table structure for `np_user`
-- ----------------------------
DROP TABLE IF EXISTS `np_user`;
CREATE TABLE `np_user` (
  `user_id` int(11) NOT NULL AUTO_INCREMENT,
  `user_mobile` varchar(60) DEFAULT NULL COMMENT '手机号',
  `user_username` varchar(255) DEFAULT NULL COMMENT '用户名',
  `user_nickname` varchar(255) DEFAULT NULL COMMENT '昵称',
  `user_password` varchar(255) DEFAULT NULL COMMENT '密码',
  `user_type` int(11) DEFAULT NULL COMMENT '会员类型,1资金方,2执行方,3都有',
  `user_sex` int(11) DEFAULT NULL COMMENT '1男2女',
  `user_token` varchar(255) NOT NULL COMMENT '用户唯一token',
  `user_regtime` varchar(60) NOT NULL COMMENT '注册时间',
  `user_status` int(2) NOT NULL DEFAULT '1' COMMENT '1,正常,0禁封',
  `user_anthen` int(2) NOT NULL DEFAULT '0' COMMENT '是否认证,0未认证,1个人认证,2企业认证',
  `user_header` varchar(255) DEFAULT NULL COMMENT '头像',
  `proxy_city` text COMMENT '区域',
  `role` int(11) NOT NULL DEFAULT '0' COMMENT '角色',
  `relation_id` varchar(255) DEFAULT NULL COMMENT '记录用户所属id',
  `sign_start_time` varchar(255) DEFAULT NULL COMMENT '签约开始时间',
  `sign_end_time` varchar(255) DEFAULT NULL COMMENT '签约结束时间',
  `contract` varchar(255) DEFAULT '' COMMENT '合同地址',
  `c_status` varchar(255) DEFAULT '0' COMMENT '是否已签合同',
  PRIMARY KEY (`user_id`)
) ENGINE=InnoDB AUTO_INCREMENT=28 DEFAULT CHARSET=utf8 COMMENT='用户表';

-- ----------------------------
-- Records of np_user
-- ----------------------------

